import React from 'react';
import CountUp from 'react-countup';

const StudentsTrained = () => {
  return (
    <div className="flex flex-col items-center bg-gray-800 text-white p-6 rounded-lg shadow-lg">
      <h2 className="text-3xl font-bold mb-2">Students Trained</h2>
      <CountUp
        start={0}
        end={500}  // Replace 500 with your actual number
        duration={3}  // Duration of the animation in seconds
        separator=","
        className="text-5xl font-extrabold"
      />
      <p className="text-xl mt-2">and counting...</p>
    </div>
  );
};

export default StudentsTrained;
